import java.util.Random

val users = Seq(100,101,102,103,104,105,106)

val snacks = Seq("apple", "chips", "yogurt", "bread", "cake", "tart")
val snacksLen = snacks.length-1
val startingTime = Timestamp.valueOf("2020-04-17 12:00:00")


val generator = new Random(100L);

def randomSnack(): String = {
  snacks(Math.round(generator.nextInt(snacksLen)))
}

def randomQuantity(num: Int): Int = {
  Math.round(generator.nextInt(num))
}

def randomSnacking(user: Int): Seq[Snack] = {
  (1 to 100).map(index => {
    val secondsOffset = Math.round(generator.nextInt(100*index))
    val ts = Timestamp.from(startingTime.toInstant.plusSeconds(secondsOffset))
    Snack(ts, randomSnack(), randomQuantity(index), user)
  })
}

val snackingBehavior = users.map(randomSnacking).flatten

